import React, {useState} from 'react';
import { Header } from './Components/Header';
import { CitySelect } from './Components/CitySelect';
import { SpotifyEmbed } from './Components/SpotifyEmbed';

const cityOptions = {
  "new-york": {
    label: "New York",
    value: "new-york",   
    id: 1234
  },
  "los-angeles": {
    label: "Los Angeles",
    value: "los-angeles",    
    id: 1235
  },
  "columbus": {
    label: "Columbus",
    value: "columbus",   
    id: 1237
  }
};

function App() {

  const [ city, setCity ] = useState('new-york');
  const cityData = props.cityOptions[props.city];


  return (
    <div className="h-full">
      <Header />
      <CitySelect
        city={city}
        setCity={setCity}
        cityOptions={cityOptions}
      />
      <p>City: {cityData.label}</p>       
      <p>ID: {cityData.id} </p>     
      <SpotifyEmbed />
    </div>
  );
}

export default App;
